public void setNext(IntrusiveCollection<? extends Element> list, Element next) {
  for (int i = 0; i < triplets.length; i += 3) {
    if (triplets[i] == list) {
      triplets[i + 2] = next;
      return;
    }
  }
  throw new RuntimeException("Called setNext on an element that wasn't " +
      "in the list.");
}
